import styled from '@emotion/styled'
import { ProductCardTall } from './ProductCardTall'

const Container = styled.div`
  width: 90%;
  margin: 3rem auto;
  background-color: white;

  padding: 2rem 2rem;
`

const ProductContainer = styled.div`
  display: flex;
  > div + div {
    margin-left: 1rem;
  }
`

export const ProductRelated = () => {
  return (
    <Container>
      <ProductContainer>
        <ProductCardTall />
        <ProductCardTall />
        <ProductCardTall />
      </ProductContainer>
    </Container>
  )
}
